import React from 'react';
import BandCard from './BandCard';

/* remove me */
import alvvays from '../assets/alvvays.jpeg';
import phoebe from '../assets/phoebe-bridgers.jpeg';
import sylvan from '../assets/sylvan-esso.jpeg';
import foxygen from '../assets/foxygen.jpeg';

class TopBands extends React.Component {

  render() {
    return (
      <div>
        <h2 className="ui header">Top Bands</h2>
        <div className="ui stackable four column grid">
          <div className="row">
            <div className="column"><BandCard imagePath={alvvays} bandName="Alvvays" /></div>
            <div className="column"><BandCard imagePath={phoebe} bandName="Alvvays" /></div>
            <div className="column"><BandCard imagePath={sylvan} bandName="Alvvays" /></div>
            <div className="column"><BandCard imagePath={foxygen} bandName="Alvvays" /></div>
          </div>
        </div>
      </div>
    );
  }

}

export default TopBands;
